DROP TABLE IF EXISTS `t_tag_group_vip`;
CREATE TABLE `t_tag_group_vip`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '标签组ID',
  `tag_group_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '标签组名称（渠道下唯一）',
  `tag_group_cate_id` int(11) NOT NULL COMMENT '标签组分类ID',
  `tag_group_source` tinyint(1) NOT NULL DEFAULT 0 COMMENT '标签组来源（0：系统，1：自定义，2：用户行为指标 3：外部）',
  `create_way` tinyint(1) NOT NULL DEFAULT 0 COMMENT '创建方式（0：系统创建，1：自定义创建，2：导入创建）',
  `custom_type` tinyint(1) NOT NULL DEFAULT 0 COMMENT '自定义类型（0：无，1：自定义标签值，2：事件偏好属性）',
  `is_init_data` tinyint(1) NULL DEFAULT 0 COMMENT '是否初始化数据（系统创建标签）',
  `sort` int(11) NOT NULL COMMENT '排序',
  `remark` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '备注',
  `layer_count` int(11) NULL DEFAULT 0 COMMENT '覆盖人数（汇总分层数据）',
  `count_update_time` datetime(0) NULL DEFAULT NULL COMMENT '人数更新时间',
  `click_count` int(11) NULL DEFAULT NULL COMMENT '点击次数',
  `invoke_count` int(11) NULL DEFAULT NULL COMMENT '调用次数',
  `expression` mediumtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '标签组父级计算表达式（目前事件偏好使用）',
  `attribute_model_type` int(11) NULL DEFAULT NULL COMMENT '配置模板code',
  `push_count` int(11) NULL DEFAULT NULL COMMENT '推送次数',
  `deal_status` tinyint(4) NULL DEFAULT 0 COMMENT '计算状态 0计算中 1计算完成 2计算失败 3计算停止 4创建中 5创建失败',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `creater` bigint(20) NULL DEFAULT NULL COMMENT '创建人ID',
  `creater_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '创建人姓名',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `updater` bigint(20) NULL DEFAULT NULL COMMENT '更新人ID',
  `updater_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '更新人姓名',
  `is_deleted` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否删除（0：未删除，1：已删除）',
  `tag_group_extend_id` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '扩展id（存第三方唯一码）',
  `data_range` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '数据范围',
  `tag_detail_status` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '标签详情处理状态',
  `is_not_limit` int(11) NULL DEFAULT NULL COMMENT '是否不限制行为对象',
  `event_param` mediumtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '入参，行为对象不限时需要',
  `limit_data_range` tinyint(1) NULL DEFAULT NULL COMMENT '1单渠道单店铺 ',
  `is_not_sync_to_crowd` tinyint(1) NULL DEFAULT NULL COMMENT '是否同步到人群',
  `is_not_support_store` tinyint(1) NULL DEFAULT NULL COMMENT '是否支持到店铺，逻辑同是否同步到人群字段',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_tag_group_extend_id`(`tag_group_extend_id`) USING BTREE,
  INDEX `tag_group_source`(`tag_group_source`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 14141 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '会员标签组表' ROW_FORMAT = Dynamic;

